sys_variable_value.value:
(function execute(inputs, outputs) {
  // Add Last Sync Time to Integration Settings Page
  var rec = new GlideRecord('x_caci_cisco_ise_cisco_ise_config_table');
  rec.addQuery('use_mid_server',true);
  rec.query(); 
  while(rec.next()) {
    rec.last_sync = new GlideDateTime();
  	rec.update();
  }

  // Parse Last Import Time and convert to ISE format(ISO) to be used in the request
  // 0000-00-00T00:00:00Z
  var d = new GlideDateTime();
  outputs.last_run = new Date(inputs.last_import_time).toISOString();
  // outputs.last_run = last_import_ts;
  // outputs.last_run = "2023-10-11T16:06:52Z";
})(inputs, outputs);

